import React, { Component } from "react";

import classes from "./About.module.css";
import Card from "./UI/Card";
import selfie from "../assets/img/aaron_selfie__dark_square.png";
import Skill from "./Skill";

class About extends Component {
  render() {
    return (
      <section id="section-about" className={classes.aboutSection}>
        <div className={classes.aboutBox}>
          <div className={classes.aboutHeader}>
            <h3>About</h3>
            <p>Let me introduce myself!</p>
          </div>
          <div className={classes.intro}>
            <img
                className={classes.selfie}
                src={selfie}
                alt="A selfie of Aaron"
              />
            <p>Typing</p>
          </div>

          <div className={classes.box_2_col}>
            <div className={classes.row_1_span_2}>
              <div className={classes.skillsBox}>
                <h3>Skills</h3>
                <Skill name="Java" value={8}></Skill>
                <Skill name="C++" value={7}></Skill>
                <Skill name="React" value={4}></Skill>
                <Skill name="Javascript/CSS/HTML" value={5}></Skill>
              </div>
            </div>
            <div className={classes.row_1_span_2}></div>
          </div>
        </div>
      </section>
    );
  }
}

export default About;
